paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 2);
            }

            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 2 ? 2 : value));
            let normalizedValue = (value - 0) / (2 - 0);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 2 ? 2 : value));
            let normalizedValue = (value - 0) / (2 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 3);
            }

            return normalizedValue;
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 0.999 ? 0.999 : value));
            let normalizedValue = (value - 0) / (0.999 - 0);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 1 ? 1 : (value > 2000 ? 2000 : value));
            let normalizedValue = (value - 1) / (2000 - 1);
            return normalizedValue;
        }
    case 3:
        {
            value = (value < 100 ? 100 : (value > 2000 ? 2000 : value));
            let normalizedValue = (value - 100) / (2000 - 100);
            return normalizedValue;
        }
    case 6:
        {
            value = (value < 0.01 ? 0.01 : (value > 0.99 ? 0.99 : value));
            let normalizedValue = (value - 0.01) / (0.99 - 0.01);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                value = this.applyStepsToNormalizedParameterValue(value, 2);
            }

            {
                return 0 + value * (1 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (2 - 0);
            }
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                value = this.applyStepsToNormalizedParameterValue(value, 3);
            }

            {
                return 0 + value * (2 - 0);
            }
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (0.999 - 0);
            }
        }
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 1 + value * (2000 - 1);
            }
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 100 + value * (2000 - 100);
            }
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.01 + value * (0.99 - 0.01);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));

            {
                const oneStep = 1 / 1;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 1:
        {
            v = (v > 2 ? 2 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 2 ? 2 : (v < 0 ? 0 : v));

            {
                const oneStep = 2 / 2;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 3:
        {
            v = (v > 2000 ? 2000 : (v < 100 ? 100 : v));
            return v;
        }
    case 4:
        {
            v = (v > 0.999 ? 0.999 : (v < 0 ? 0 : v));
            return v;
        }
    case 5:
        {
            v = (v > 2000 ? 2000 : (v < 1 ? 1 : v));
            return v;
        }
    case 6:
        {
            v = (v > 0.99 ? 0.99 : (v < 0.01 ? 0.01 : v));
            return v;
        }
    default:
        return value;
    }
}
